@Watch Woman of The Dragon It'll take a few hundred more years until we may have fully understood what food does what in our body and which components are important. So I propose trying to get the nutrients as much as possible directly from healty natural foods.
Vitamin D I take myself, 4000IE a day which simulates a short sunbath (plus dark-green vegetables o lentils for vitamin K). Calcium I don't like supplementing, the pills might change the pH value in the digestion tract and cause long-term digestive problems. Magnesium(citrate!) and Zinc I sometimes supplement, but eating enough nuts & seeds & vegetables & whole grains should suffice. B complex should hopefully not replace eating a variety of fruits and vegetables.
Stay healthy :)

