Notice that during the time that the ark was being built, Noah was preaching to others and warning them so if they choose some could have accepted the warning and been saved. So, Jehovah, God lovingly gave a long time of warning and only destroyed the wicked and protected those who loved him. This is fair even we as imperfect humans lock up wicked people in jails and prisons and some Nations pull the wicked to death, why? To protect good law abiding people. Life would be horrible if the wicked were allowed to run free among us. If we as imperfect humans have this sense of justice and recognize the need to separate the wicked from the good how much more so would God who is prefect in his justice. 

Another reason for the flood was a warning example for us today. Jesus said in the time of the end conditions on earth would be like the time of the flood. Please notice Matthew 24: 37-39 “For just as the days of Noah were, so the presence of the Son of man will be. For as they were in those days before the Flood, eating and drinking, men marrying and women being given in marriage, until the day that Noah entered into the ark, and they took no note until the Flood came and swept them all away, so the presence of the Son of man will be.”

