@William Moore During WW2 (and for decades after) ration packs included cigarettes, often in tins of 50, with names such as "Senior Service" and "Capstan  Full Strength", untipped of course. These were free issue to all services, but the War Office (later the Ministry of Defence) paid the tobacco companies for them.

In the UK we cannot grow tobacco, so it had to be imported and during the war many lives were lost carrying this "precious", "vital" commodity across the Atlantic.

